import React from 'react'
import { render } from 'react-dom'
import '../../App.css';
import Nav from 'react-bootstrap/Nav';
import { MDBIcon, MDBContainer, MDBBtn } from 'mdbreact';
import data from './SubNavbarData.json';


export default class SubNavbar extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      page_id: props.page_id,
      submenu_id: "touchAble",
      data: data
    };
  }


findString(props){
let string = "";

if (props.input1 === props.input2)
return (props.input2);
    return (
    ""
    )
}

createSubMenus(){
    let submenu_id = this.state.submenu_id
    let page_id = this.state.page_id;
    const data = this.state.data;
    //const data3 = this.state.data2["products"];
    // const data2 = JSON.parse(data).filter(function (data) {
    //     return data.app_id === 'touchAble';
    // });

    const products = data.products;
    var product;
    var add_id = "";
    for(var i=0; i < products.length; ++i) {
        var product_i = products[i];
        if(product_i.app_id == page_id) {
            product = product_i;
            break;
        }
    }

    if (!product) {
        return ( 
            <ul class="navbar-nav w-100 justify-content-start">
            <a class="navbar-brand" href="#" onClick={submenu_id = "landing_page", this.props.selectSubPage.bind(this,submenu_id)}>
            {content}
            </a>  
            <li class="nav-item active">
                <a class="nav-link" onClick={submenu_id = "manual", this.props.selectSubPage.bind(this,submenu_id)} href="#">manual</a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#" onClick={submenu_id = "setup-win", this.props.selectSubPage.bind(this,submenu_id)}>windows</a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#" onClick={submenu_id = "setup-mac", this.props.selectSubPage.bind(this,submenu_id)}>mac</a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#" onClick={submenu_id = "faq", this.props.selectSubPage.bind(this,submenu_id)}>faq</a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="#" onClick={submenu_id = "faq", this.props.selectSubPage.bind(this,submenu_id)}>touchAble3</a>
            </li>
            </ul>
        );
    }

    let icon_source = "https://zerodebug.com/images/ta_logo_2048.png";
    let content;
    const json_date =  JSON.stringify(products);
    content = <div>{json_date}</div>

    content = <img src={product.icon_source} width="30"></img>





    return (

        <ul class="navbar-nav w-100 justify-content-start">
        <a class="navbar-brand" href="#" onClick={submenu_id = "landing_page", this.props.selectSubPage.bind(this,submenu_id)}>
        {content}
        </a>  
        <li class="nav-item active">
            <a class="nav-link" onClick={submenu_id = "manual", this.props.selectSubPage.bind(this,submenu_id)} href="#">manual</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#" onClick={submenu_id = "setup-win", this.props.selectSubPage.bind(this,submenu_id)}>windows</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#" onClick={submenu_id = "setup-mac", this.props.selectSubPage.bind(this,submenu_id)}>mac</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#" onClick={submenu_id = "faq", this.props.selectSubPage.bind(this,submenu_id)}>faq</a>
        </li>
        <li class="nav-item">
            <a class="nav-link" href="#" onClick={submenu_id = "faq", this.props.selectSubPage.bind(this,submenu_id)}>touchAble3</a>
        </li>
        </ul>
    )
}

createNavbar(props){
    let submenu_id = this.state.submenu_id
    let page_id = this.state.page_id;

    let submenus = this.createSubMenus();


return (
<nav class="navbar fixed-top-2 navbar-dark bg-dark navbar-expand-md bg-faded justify-content-center">
    {submenus}
    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsingNavbar3">
        <span class="navbar-toggler-icon"></span>
    </button>
    <div class="navbar-collapse collapse w-100" id="collapsingNavbar3">
        <ul class="nav navbar-nav ml-auto w-100 justify-content-end">
            <li class="nav-item">
                <a class="nav-link" href="https://www.facebook.com/touchableapp/" title="Facebook" target="_blank"><i class="fa fa-facebook" aria-hidden="true"></i></a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="https://www.twitter.com/touchableapp/" title="Twitter" target="_blank"><i class="fa fa-twitter" aria-hidden="true"></i></a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="https://www.instagram.com/touchableapp/" title="Instagram" target="_blank"><i class="fa fa-instagram" aria-hidden="true"></i></a>
            </li>
            <li class="nav-item">
                <a class="nav-link" href="https://www.instagram.com/touchableapp/" title="Instagram" target="_blank"><i class="fa fa-youtube" aria-hidden="true"></i></a>
            </li>
        </ul>
    </div>
</nav>
)
}

render() {
return (

[this.createNavbar()]

);
}

}
